import React, { FC } from 'react'
import styles from './button.module.css'
import { Link, Route } from 'react-router-dom'
import { PopupTweet } from '../../../PopupTweet/PopupTweet'

type ClickType = {
  onClickHandler?: () => void
}

export const Button: FC<ClickType> = ({ onClickHandler }) => {
  const ClickHandler = () => {
    ;<Route
      path="/popup"
      render={() => {
        return <React.Suspense fallback={<div>Loading...</div>}></React.Suspense>
      }}
    />
    if (onClickHandler) {
      onClickHandler()
    }
  }

  return (
    <>
      <Link to="/popup">
        <button type="submit" className={styles.buttonTweet} onClick={ClickHandler}>
          Tweet
        </button>
      </Link>
    </>
  )
}

export default Button
